const RatingSection = () => {
  const images = [
    {
      title: "Troop Number Eight",
      rating: "6/10",

      url: "data:image/jpeg;base64,",
    },
    {
      title: "Next Man UP",
      rating: "8.5/10",

      url: "data:image/jpeg;base64,",
    },
    {
      title: " Where It All Ends",
      rating: "9/10",

      url: "data:image/jpeg;base64,",
    },
    {
      title: "The Kids of El Dorado",
      rating: "7.5/10",

      url: "data:image/jpeg;base64,",
    },

    {
      title: "The Big Hunt",
      rating: "8.5/10",

      url: "data:image/jpeg;base64,",
    },
  ];

  const settings = {
    dots: false,
    infinite: false,
    speed: 500,
    slidesToShow: 1.3,
    slidesToScroll: 1,
    centerMode: false,
    responsive: [
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 1,
        },
      },
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 1.5,
        },
      },
    ],
    prevArrow: <CustomPrevArrow />,
    nextArrow: <CustomNextArrow />,
    // prevArrow: <CustomPrevArrow />,
    // nextArrow: <CustomNextArrow />,
  };
  const [rating, setRating] = useState([]);
  const [modalOpen, setModalOpen] = useState(false);
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const [loading, setLoading] = useState(false);

  const getrating = async () => {
    setLoading(true);
    const url = "https://onmyscreen-backend.onrender.com/blogs";
    const response = await fetch(url);
    const data = await response.json();
    if (data) {
      setRating(data?.ratingsData);
      console.log(rating, data);
      setLoading(false);
    }
  };
  useEffect(() => {
    getrating();
  }, []);
  const openModal = (index) => {
    setCurrentImageIndex(index);
    setModalOpen(true);
  };

  const closeModal = () => {
    setModalOpen(false);
  };

  const goToPrevImage = () => {
    setCurrentImageIndex((prevIndex) =>
      prevIndex === 0 ? rating.length - 1 : prevIndex - 1
    );
  };

  const goToNextImage = () => {
    setCurrentImageIndex((prevIndex) =>
      prevIndex === rating.length - 1 ? 0 : prevIndex + 1
    );
  };

  return (
    <>
      <div className="rating-section">
        <h2 className="heading">ON MY SCREEN RATING</h2>
        <hr />
        {loading ? (
          <span>loading...</span>
        ) : (
          <Slider {...settings}>
            {rating?.map((image, index) => (
              <div
                key={index}
                className="imagees-container"
                onClick={() => openModal(index)}
              >
                <img src={image.ratingImage} alt={image.title} />
                <div className="image-overlay">
                  <h3>{image.title}</h3>
                  <p>Rating: {image.rating}</p>
                </div>
              </div>
            ))}
          </Slider>
        )}
        {modalOpen && (
          <Modal
            image={rating[currentImageIndex]}
            onClose={closeModal}
            onPrev={goToPrevImage}
            onNext={goToNextImage}
            ratingModal
          />
        )}
      </div>
    </>
  );
};

export default RatingSection;
